import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';
import logo from "../images/Logo-dark-background.png"
import "../index.css"
import {NavLink} from "react-router-dom"

const Navbar = () => {
  return (
    <AppBar position="static" style={{ backgroundColor: '#100e0c' }}>
      <Toolbar>
      <img className='NavBar__logo' src={logo} alt="Logo" style={{ marginRight: '10px' }} />
        <Typography 
         variant="h6"
         component="div"
         onClick={() => <NavLink to={"/"}/>}
         className='NavBar__Nav-Link'
         > Titan Capital Financial
        </Typography>
        <div style={{ marginLeft: 'auto' }}>
          <Link href="/" color="inherit" style={{ marginRight: '15px' }}>
            Home
          </Link>
          <Link href="/about" color="inherit">
            About
          </Link>
          {/* Add more navigation links as needed */}
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
